namespace RonSijm.FluidHumidifier.Factories.MSK;

public class ClusterFactory(string resourceName = null, Action<Humidifier.MSK.Cluster> factoryAction = null) : ResourceFactory<Humidifier.MSK.Cluster>(resourceName)
{

    internal InnerClusterEncryptionInfoFactory EncryptionInfoFactory { get; set; }

    internal InnerClusterOpenMonitoringFactory OpenMonitoringFactory { get; set; }

    internal InnerClusterConfigurationInfoFactory ConfigurationInfoFactory { get; set; }

    internal InnerClusterBrokerNodeGroupInfoFactory BrokerNodeGroupInfoFactory { get; set; }

    internal InnerClusterClientAuthenticationFactory ClientAuthenticationFactory { get; set; }

    internal InnerClusterLoggingInfoFactory LoggingInfoFactory { get; set; }

    protected override Humidifier.MSK.Cluster Create()
    {
        var clusterResult = CreateCluster();
        factoryAction?.Invoke(clusterResult);

        return clusterResult;
    }

    private Humidifier.MSK.Cluster CreateCluster()
    {
        var clusterResult = new Humidifier.MSK.Cluster
        {
            GivenName = InputResourceName,
        };

        return clusterResult;
    }
    public override void CreateChildren(Humidifier.MSK.Cluster result)
    {
        base.CreateChildren(result);

        result.EncryptionInfo ??= EncryptionInfoFactory?.Build();
        result.OpenMonitoring ??= OpenMonitoringFactory?.Build();
        result.ConfigurationInfo ??= ConfigurationInfoFactory?.Build();
        result.BrokerNodeGroupInfo ??= BrokerNodeGroupInfoFactory?.Build();
        result.ClientAuthentication ??= ClientAuthenticationFactory?.Build();
        result.LoggingInfo ??= LoggingInfoFactory?.Build();
    }

} // End Of Class

